Welcome to kanalgratisdotse - the largest angling devoted channel in Scandinavia!

We are a YouTube-channel all about fishing. Pike fishing, fly fishing, sea fishing, coarse fishing - you name it. We are just as passionate about fishing as we are about filming and our goal is to give you the best fishing films on YouTube. 

New videos every week. Subscribe and stay tuned for more free high quality fishing films online!
